import React from 'react'
import "./Footer.css"
function Footer() {
    return (
        <div className="footer">
            <h1>Footer</h1>

            <div className="footer__left">
                <h1>Album song detail </h1>
            </div>

            <div className="footer__centre">
                <h1>player controls</h1>
            </div>

            <div className="footer__right">
                <h1>Volume controls</h1>
            </div>
        </div>
    )
}
//footer left 
//footer centre
